/* @flow */
import * as React from 'react'
import './stle.css';
import Block from '../../molecules/block'
type Props = {
  children?: React.Node,
  className?: string,
  image: string,
}

const Header = (props: Props): React.Element<*> => (
  <div
    className={props.className}
  >
   <Block />
  </div>
)

Header.defaultProps = {
  className: undefined,
  children: undefined,
  image: '',
}

export default Header
